function executeTasks(){

    if(dashboard.complicationWorkFlow && dashboard.complicationWorkFlow.length == 0){

        window.parent.dashboard.autoContinue = true;

        var index =  window.parent.dashboard.workflow.indexOf("Complications");

        window.parent.dashboard.workflow.splice(index, 1);

        window.parent.dashboard.exitNavPanel();

    }else{
        if(dashboard.complicationWorkFlow){

            window.parent.dashboard.exitNavPanel(tasks[dashboard.complicationWorkFlow[0]][1])

        }
        else if(dashboard.finished.length == 0){

            dashboard.showMsg("Please select complications");

        }

        

    }

      

}

function addToComplicationWorkFlow(element){

    if(!dashboard.complicationWorkFlow){

         dashboard.complicationWorkFlow = [];

    }

    if(!element.disabled && element.checked){

        dashboard.complicationWorkFlow.push(element.id);

    }
    else{

        var index = dashboard.complicationWorkFlow.indexOf(element.id);

        dashboard.complicationWorkFlow.splice(index,1)

    }

}
function executeAutoConitnue(){

	if(!dashboard.finished)
    		dashboard.finished = [];

    var tasks_keys = Object.keys(tasks);

    for(var h = 0 ;h < tasks_keys.length; h++){

        if(window.parent.dashboard.queryActiveObs("HYPERTENSION PROGRAM",visit_today,"HYPERTENSION TEST",tasks[tasks_keys[h]][0])){


                __$(tasks_keys[h]).checked = true;

                __$(tasks_keys[h]).setAttribute("disabled","disabled");

        }

    }

    if(dashboard.complicationWorkFlow && dashboard.complicationWorkFlow.length > 0){

        for(var i = 0 ; i < dashboard.complicationWorkFlow.length; i++){

            __$(dashboard.complicationWorkFlow[i]).checked = true;


            if(window.parent.dashboard.queryActiveObs("HYPERTENSION PROGRAM",visit_today,"HYPERTENSION TEST",tasks[dashboard.complicationWorkFlow[i]][0].trim())===undefined){

                dashboard.activeTask == "Complications"

                window.parent.dashboard.exitNavPanel(tasks[dashboard.complicationWorkFlow[i]][1])

            }
            else{

                __$(dashboard.complicationWorkFlow[i]).checked = true;

                __$(dashboard.complicationWorkFlow[i]).setAttribute("disabled","disabled");

                window.parent.dashboard.complicationWorkFlow.splice(0, 1);

            }

        }

        

    }
}


